// react must be required before jquery and app framework to be able to stop event propagation
// See http://stackoverflow.com/questions/24415631/reactjs-syntheticevent-stoppropagation-only-works-with-react-events
require(['jquery', 'appframework', 'fastclick',
        'scripts/StateManager', 'scripts/IndexManager', 'scripts/ExerciseManager',
        'scripts/components/CircularTimer',
        'scripts/components/NoExercises',
        'scripts/components/Exercises',
        'scripts/components/ExercisesHeader',
        'scripts/components/ExercisesController',
        'scripts/components/Index',
        'scripts/components/Menu',
        'scripts/components/Indices',
        'scripts/components/ManageIndices',
        'scripts/components/AddIndex',
        'scripts/components/Settings',
        'scripts/components/About',
        'scripts/components/Help',
        'react', 'react-dom'],
        function ($, appframework, FastClick,
                  StateManager, IndexManager, ExerciseManager,
                  CircularTimer,
                  NoExercises,
                  Exercises,
                  ExercisesHeader,
                  ExercisesController,
                  Index,
                  Menu,
                  Indices,
                  ManageIndices,
                  AddIndex,
                  Settings,
                  About,
                  Help,
                  React,
                  ReactDOM) {
    $.afui.ready(function () {
        $.afui.useInternalRouting = true;
        $.afui.setBackButtonVisibility(false);
        $.afui.manageHistory=false;
        $.afui.enableTabBar();
        FastClick.attach(document.body);


        $.feat.nativeTouchScroll=true;

        $.afui.launch();

        function renderExercises(state) {
            var exerciseManager = state.manager;

            ReactDOM.render(React.createElement(ExercisesHeader, {key: "exerciseHeader", exerciseManager: exerciseManager}), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(Exercises, {key: "exercises", state: state, exerciseManager: exerciseManager, stateChanged: renderExercises}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement(ExercisesController, {key: "exercisesController", exerciseManager: exerciseManager}), document.getElementById('mountPageController'));
        }

        function renderNoExercises(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(NoExercises, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderIndices(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(Indices, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderManageIndices(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(ManageIndices, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderAddIndex(state, entry) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(AddIndex, {state: state, entry: entry}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderSettings(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(Settings, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderAbout(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(About, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderHelp(state) {
            ReactDOM.render(React.createElement("h1", null, "Trainer-Coach"), document.getElementById('mountAppHeader'));
            ReactDOM.render(React.createElement(Help, {state: state}), document.getElementById('mountPageViewer'));
            ReactDOM.render(React.createElement("span", null), document.getElementById('mountPageController'));
        }

        function renderApp(state) {
            var showState;
            var showStateParams;

            console.log("renderApp [" + state.showState + "]");
            ReactDOM.render(React.createElement(Menu, {key: "menu", state: state}), document.getElementById('mountLeftMenu'));
            if (typeof state.showState === 'string' || state.showState instanceof String) {
                showState = state.showState;
                showStateParams = null;
            } else {
                showState = state.showState.showState;
                showStateParams = state.showState.showStateParams;
            }
            switch (showState) {
                case state.SHOW_INDICES:
                    renderIndices(state);
                    break;

                case state.SHOW_MANAGEINDICES:
                    renderManageIndices(state);
                    break;

                case state.SHOW_ADDINDEX:
                    renderAddIndex(state, showStateParams === null? -1 : showStateParams.entry);
                    break;

                case state.SHOW_SETTINGS:
                    renderSettings(state);
                    break;

                case state.SHOW_ABOUT:
                    renderAbout(state);
                    break;

                case state.SHOW_HELP:
                    renderHelp(state);
                    break;

                case state.SHOW_EXERCISES:
                    renderExercises(state);
                    break;

                case state.SHOW_NOEXERCISES:
                default:
                    renderNoExercises(state);
                    break;
            }
        }

        var state = new StateManager("TrainerCoach", renderApp);
        state.initialize();

        // for debugging purposes, keep track of appState
        console.log("Keep track of appState as window.appState");
        window.appState = state;

        renderApp(state);
    });
});
